import React from 'react';

function Services(props) {
    return(
        <div>
            <h1>Saloon Services available => {props.offer1}</h1>
            <h1>Saloon Services availale => {props.offer2}</h1>
            <h1>Saloon Services available => {props.offer3}</h1>

            
        </div>


    );
}

export default Services;
